import logo from "../static/twitter-icon-svg.jpg";

const TweetPost = () => {
  return (
    <div className="flex justify-between min-h-[600px] mx-[16px] my-[12px]">
      <div className="w-[48px] pr-[12px] h-full">
        <img src={logo} alt=""></img>
      </div>
      <div>Tweet</div>
    </div>
  );
};

export default TweetPost;
